import React from "react";
import { Box } from "@mui/material";
import "./NewsEvents.css";

const NewsEvents = () => {
  return (
    <div className="news-main-container">
      <div className="news-left-container">
        <h2 className="news-main-title">Latest News & Announcement</h2>
        <p className="news-main-subtitle">
          From campus highlights to student success stories â€” all in one place.
        </p>

        <div className="news-columns">
          {/* Admissions */}
          <div className="news-column">
            <h3 className="news-column-title">Admissions</h3>
            <Box
              className="news-list"
              sx={{
                maxHeight: 300,        
                overflowY: "auto",
                "&::-webkit-scrollbar": {
                  width: "8px",
                },
                "&::-webkit-scrollbar-thumb": {
                  backgroundColor: "#888",
                  borderRadius: "4px",
                },
                "&::-webkit-scrollbar-thumb:hover": {
                  backgroundColor: "#555",
                },
              }}
            >
              {admissionsData.map((item, idx) => (
                <div key={idx} className="news-item">
                  <div className="news-date">
                    <span className="month">{item.month}</span>
                    <span className="day">{item.date}</span>
                  </div>
                  <div className="news-content">
                    {item.content}
                    <a href={item.link} className="news-link">
                      {item.linkText}
                    </a>
                  </div>
                </div>
              ))}
            </Box>
            <button className="view-all-btn">View All</button>
          </div>

          {/* Academics & Exams */}
          <div className="news-column">
            <h3 className="news-column-title">Academics & Exams</h3>
            <Box
              className="news-list"
              sx={{
                maxHeight: 300,
                overflowY: "auto",
                "&::-webkit-scrollbar": {
                  width: "8px",
                },
                "&::-webkit-scrollbar-thumb": {
                  backgroundColor: "#888",
                  borderRadius: "4px",
                },
                "&::-webkit-scrollbar-thumb:hover": {
                  backgroundColor: "#555",
                },
              }}
            >
              {academicsData.map((item, idx) => (
                <div key={idx} className="news-item">
                  <div className="news-date">
                    <span className="month">{item.month}</span>
                    <span className="day">{item.date}</span>
                  </div>
                  <div className="news-content">
                    {item.content}
                    <a href={item.link} className="news-link">
                      {item.linkText}
                    </a>
                  </div>
                </div>
              ))}
            </Box>
            <button className="view-all-btn">View All</button>
          </div>
        </div>
      </div>

      {/* Happenings Right */}
      <div className="news-right-container">
        <h3 className="happenings-title">Happenings</h3>
        <p className="happenings-subtitle">
          Catch every event for shaping our journey
        </p>
        <Box
          className="happenings-list"
          sx={{
            maxHeight: 500, // adjust height
            overflowY: "auto",
            "&::-webkit-scrollbar": {
              width: "8px",
            },
            "&::-webkit-scrollbar-thumb": {
              backgroundColor: "#888",
              borderRadius: "4px",
            },
            "&::-webkit-scrollbar-thumb:hover": {
              backgroundColor: "#555",
            },
          }}
        >
          {happeningsData.map((item, idx) => (
            <div key={idx} className="happening-item">
              <img src={item.image} alt={item.title} className="happening-image" />
              <p className="happening-title">{item.title}</p>
            </div>
          ))}
        </Box>
      </div>
    </div>
  );
};

export default NewsEvents;
